import React from 'react'
import styled from 'styled-components'



const Container = styled.div`
    margin-bottom: 45px;
    width: 350px;
    cursor: pointer;
`;

const Image = styled.img`
    width: 100%;
    height: 202px;
    background-color: #999999;
`;
const Details = styled.div`
    display: flex;
    margin-top: 16px;
    gap: 12px;
`;

const ChannelImage = styled.img`
    width: 36px;
    height:36px;
    border-radius: 50%;
    background-color: #999999;
`;


const Card = () => {
    return (
        <Container>
            <Image />
            <Details>
                <ChannelImage />
            </Details>
        </Container>

    )
}

export default Card
